In rectangle $ABCD$, angle $C$ is trisected by $\overline{CF}$ and $\overline{CE}$, where $E$ is on $\overline{AB}$, $F$ is on $\overline{AD}$, $BE=6$, and $AF=2$. Find the area of $ABCD$.

[asy]
import olympiad; import geometry; size(150); defaultpen(linewidth(0.8)); dotfactor=4;
real length = 2 * (6*sqrt(3) - 2), width = 6*sqrt(3);
draw(origin--(length,0)--(length,width)--(0,width)--cycle);
draw((length,width)--(0,2)^^(length,width)--(length - 6,0));
dot("$A$",origin,SW); dot("$B$",(length,0),SE); dot("$C$",(length,width),NE); dot("$D$",(0,width),NW); dot("$F$",(0,2),W); dot("$E$",(length - 6,0),S);
[/asy]

Jeremy made a Venn diagram showing the number of students in his class who own types of pets. There are 32 students in his class. In addition to the information in the Venn diagram, Jeremy knows half of the students have a dog, $\frac{3}{8}$ have a cat, six have some other pet and five have no pet at all. How many students have all three types of pets (i.e. they have a cat and a dog as well as some other pet)? [asy]unitsize(50);
import graph;
pair A = (0,-1); pair B = (sqrt(3)/2,1/2); pair C = (-sqrt(3)/2,1/2);
draw(Circle(A,1.2) ^^ Circle(B,1.2) ^^ Circle(C,1.2));
label("10",A); label("2",B); label("9",C); label("$z$",(0,0)); label("$w$",(B+C)/2); label("$y$",(A+B)/2); label("$x$",(A+C)/2);
label("Cats",1.5C,C); label("Other Pets",2B,C); label("Dogs", 1.7A,A);[/asy]

Let $P$ be the point on line segment $\overline{AB}$ such that $AP:PB = 3:2.$  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants $t$ and $u.$  Enter the ordered pair $(t,u).$

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,3/5);

draw(A--B);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, S);
[/asy]

In rectangle $ABCD$, $AB=5$ and $BC =3$. Points $F$ and $G$ are on $\overline{CD}$ so that $DF = 1$ and $GC=2$. Lines $AF$ and $BG$ intersect at $E$. Find the area of $\triangle AEB$. Express your answer as a common fraction. [asy]
pair A,B,C,D,I,F,G;
A=(0,0);
B=(5,0);
C=(5,3);
D=(0,3);
F=(1,3);
G=(3,3);
I=(1.67,5);
draw(A--B--C--D--cycle,linewidth(0.7));
draw(A--B--I--cycle,linewidth(0.7));
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,NE);
label("$D$",D,NW);
label("$F$",F,SE);
label("$G$",G,SW);
label("$E$",I,N);
label("1",(0.5,3),N);
label("2",(4,3),N);
label("3",(0,1.5),W);
label("3",(5,1.5),E);
label("5",(2.5,0),S);
[/asy]

In the diagram, $\angle PQR=\angle PRQ$.  If $QR=5$ and $PR=7$, what is the perimeter of $\triangle PQR$? [asy]
draw((0,0)--(2.5,7.43)--(5,0)--cycle);
label("5",(2.5,0),S);
label("$Q$",(0,0),SW);
label("$R$",(5,0),SE);
label("$P$",(2.5,7.43),N);
label("7",(4.2,3.7));
[/asy]

