A section is cut out of a circular piece of paper having radius four inches, as shown. Points A and B are then glued together to form a right circular cone. What is the circumference of the base of the resulting cone? Express your answer in terms of $\pi$.  (The $270^\circ$ sector forms the cone.)

[asy]import graph;
draw(Circle((0,0),42.4),linewidth(1));
draw((0,0)--(30,30),linewidth(2));
draw((0,0)--(30,-30),linewidth(2));
label("$A$",(30,30),E);
label("$B$",(30,-30),E);
label("4''",(15,15),NW);
draw((3,3)--(6,0));
draw((6,0)--(3,-3));

[/asy]

The graphs of two functions, $p(x)$ and $q(x),$ are shown here on one set of axes: [asy]
size(150);
real ticklen=3;
real tickspace=2;

real ticklength=0.1cm;
real axisarrowsize=0.14cm;
pen axispen=black+1.3bp;
real vectorarrowsize=0.2cm;
real tickdown=-0.5;
real tickdownlength=-0.15inch;
real tickdownbase=0.3;
real wholetickdown=tickdown;
void rr_cartesian_axes(real xleft, real xright, real ybottom, real ytop, real xstep=1, real ystep=1, bool useticks=false, bool complexplane=false, bool usegrid=true) {

import graph;

real i;

if(complexplane) {

label("$\textnormal{Re}$",(xright,0),SE);

label("$\textnormal{Im}$",(0,ytop),NW);

} else {

label("$x$",(xright+0.4,-0.5));

label("$y$",(-0.5,ytop+0.2));

}

ylimits(ybottom,ytop);

xlimits( xleft, xright);

real[] TicksArrx,TicksArry;

for(i=xleft+xstep; i<xright; i+=xstep) {

if(abs(i) >0.1) {

TicksArrx.push(i);

}

}

for(i=ybottom+ystep; i<ytop; i+=ystep) {

if(abs(i) >0.1) {

TicksArry.push(i);

}

}

if(usegrid) {

xaxis(BottomTop(extend=false), Ticks("%", TicksArrx ,pTick=gray(0.22),extend=true),p=invisible);//,above=true);

yaxis(LeftRight(extend=false),Ticks("%", TicksArry ,pTick=gray(0.22),extend=true), p=invisible);//,Arrows);

}

if(useticks) {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, Ticks("%",TicksArry , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, Ticks("%",TicksArrx , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

} else {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, above=true, Arrows(size=axisarrowsize));

}
};
rr_cartesian_axes(-4,4,-4,4);
real f(real x) {return abs(x)-2;}
real g(real x) {return -abs(x);}
draw(graph(f,-4,4,operator ..), blue+1.25);
draw(graph(g,-4,4,operator ..), orange+1.25);
draw((-3,-5)--(-1,-5),blue+1.25); label("$y=p(x)$",(-1,-5),E);
draw((-3,-6)--(-1,-6),orange+1.25); label("$y=q(x)$",(-1,-6),E);
[/asy] Each small box in the grid is $1$ unit by $1$ unit.

If $q(p(x))$ is evaluated at $x=-4,$ $-3,$ $-2,$ $-1,$ $0,$ $1,$ $2,$ $3,$ $4,$ what is the sum of the nine values obtained in this way?

Cylinder $B$'s height is equal to the radius of cylinder $A$ and cylinder $B$'s radius is equal to the height $h$ of cylinder $A$. If the volume of cylinder $A$ is twice the volume of cylinder $B$, the volume of cylinder $A$ can be written as $N \pi h^3$ cubic units. What is the value of $N$?

[asy]
size(4cm,4cm);
path a=(0,-1.2)..(-10,0)--(10,0)..cycle;
path b=(17,-0.9)..(13,0)--(21,0)..cycle;
path c=(0,1.2)..(-10,0)--(10,0)..cycle;
path d=(17,0.9)..(13,0)--(21,0)..cycle;
draw(c);
draw(d);
draw(shift((0,7))*a);
draw(shift((0,7))*c);
draw(shift((0,15))*b);
draw(shift((0,15))*d);
draw((-10,0)--(-10,7));
draw((10,0)--(10,7));
draw((13,0)--(13,15));
draw((21,0)--(21,15));
draw(a);
draw(b);
label("$A$",(0,9),N);
label("$B$",(17,18),N);
[/asy]

A floor decoration is a circle with eight rays pointing from the center.  The rays form eight congruent central angles.  One of the rays points due north.  What is the measure in degrees of the smaller angle formed between the ray pointing East and the ray pointing Southwest?

